import React from 'react';

const NumberSquare = (props) => {

    let square = <div></div>

    if (props.prime) {
        square = <div style={{ width: '70px', height: '70px', border: '1px solid black', background: 'green', textAlign: 'center', fontSize: '50px' }}> {props.number} </div>
    } else {
        square = <div style={{ width: '70px', height: '70px', border: '1px solid black', textAlign: 'center', fontSize: '50px' }}> {props.number} </div>
    }

    return (
        <div>
            {square}
        </div>
    )

}

export default NumberSquare;
